import React from 'react'
import NavBar from './NavBar'
import Styles from "./NavBarO.module.css"

export const navBarO = (props) => {
    console.log(props.isScrolling)

    return (
        <nav className={props.isScrolling < 50 ? Styles.navBar : Styles.navBar + " " + Styles.sticky}>
            <h1>MatiasFeliz </h1>
            <NavBar />
        </nav>
    )
}

export default navBarO
